leuke film

met de stemmen van Zach Tyler, Nicolas Cage en Julia Roberts

Wanneer Lucas Nickle met zijn waterpistool een complete mierenhoop onder laat lopen, wordt hij op magische wijze gekrompen tot 
het formaat van een insect. Nu hij zo groot is als de mieren wordt hij veroordeeld tot zware arbeid in het mierengangenstelsel 
welke hij zojuist heeft vernietigd.
